import React from "react";

import "./ResumeSection.css";

const ResumeSection = porps => {
    return (
        <div className={porps.className}>
            <div className="title-header-container">
                <h3>{props.title}</h3>
            </div>
            {porps.children}
        </div>
    );
};

export default ResumeSection;
